INSERT INTO `appaction` VALUES ('0d2f1b26-c76f-46dd-86eb-abee77a634d5', '台风前夕城管救助女童', ' 当晚，六合大队龙池中队夜间巡查队员在龙池湖时代广场附近例行巡查时，发现一名小女孩独自站在路边，满脸泪痕、手足无措、神情慌张，巡查队员立即上前进行询问，经过耐心的询问得知小女孩是出来找妈妈的，但是并没有找到妈妈也忘记回家的路。了解情况后，巡查队员立即拨打了110，但考虑到小女孩的安全，队员一直陪着小女孩等待民警到来，不时地安慰缓解小女孩的情绪；不久出勤民警赶到，巡查队员立即上前与民警对接相关情况后将小女孩交到民警手上。', '2018-07-23 13:07:54', '通过', '当晚，六合大队龙池中队夜间巡查队员在龙池湖时代广场附近例行巡查时，发现一名小女孩独自站在路边，满脸泪痕、手足无措、神情慌张，巡查队员立即上前进行询问，经过耐心的询问得知小女孩是出来找妈妈的，但是并没有找到妈妈也忘记回家的路。了解情况后，巡查队员立即拨打了110，但考虑到小女孩的安全，队员一直陪着小女孩等待民警到', 'e769827e-7ceb-4fbf-b051-f4135326e9b2');
INSERT INTO `appaction` VALUES ('17e50379-630b-45a2-a087-34a93340da1e', '哈尔滨市城市管理局所属事业单位公开招聘高层次', ' 4月24日，市环卫办开展了“生活垃圾处理设施运营情况”监督检查“双随机”抽查工作。现将相关情况公示\r\n如下：\r\n\r\n一、本次行政执法人员共2名：谭洪利和李春洋，系在我单位行政执法人员名录库中随机抽取产生。\r\n\r\n二、本次行政检查的对象分别为为黑龙江新世纪能源有限公司和哈尔滨市双琦环保资源利用有限公司，系在随机抽查对象名录库中随机抽取产生。', '2018-07-28 22:01:58', '待审核', '你说的对', 'e769827e-7ceb-4fbf-b051-f4135326e9b2');
INSERT INTO `appaction` VALUES ('7b8ea003-ebec-4deb-b9f0-8000b198b2af', '所属事业单位公开招聘高层次', ' 4月24日，市环卫办开展了“生活垃圾处理设施运营情况”监督检查“双随机”抽查工作。现将相关情况公示\r\n如下：\r\n\r\n一、本次行政执法人员共2名：谭洪利和李春洋，系在我单位行政执法人员名录库中随机抽取产生。\r\n\r\n二、本次行政检查的对象分别为为黑龙江新世纪能源有限公司和哈尔滨市双琦环保资源利用有限公司，系在随机抽查对象名录库中随机抽取产生。', '2018-07-28 22:01:54', '待审核', '害的', 'e769827e-7ceb-4fbf-b051-f4135326e9b2');
INSERT INTO `appaction` VALUES ('93fe6fff-e176-4a1d-ab0d-027c0eaba5fa', '上饶城管队员来帮扶', ' 考虑到姐弟俩后续读书还需要很多费用，市城管执法局步行街管理办负责人谢大斌除带头义捐外，还和姐弟俩及其父亲表达了如果他们需要，步行街管理办会积极与步行街商家联系，为小女孩找到勤工俭学的机会，并且还会与社会上的慈善企业沟通，努力为姐弟俩争取到企业的长期资助。', '2018-07-28 22:01:52', '待审核', '考虑到姐弟俩后续读书还需要很多费用，市城管执法局步行街管理办负责人谢大斌除带头义捐外，还和姐弟俩及其父亲表达了如果他们需要，步行街管理办会积极与步行街商家联系，为小女孩找到勤工俭学的机会', 'e769827e-7ceb-4fbf-b051-f4135326e9b2');
INSERT INTO `appaction` VALUES ('de76cdd0-67e9-4028-bfd7-445d1519d2c1', '城管执法根除城市制霸', ' 在龙岗区委区政府的正确领导下，该局以“严执法、重实效”作为全区百日行动总要求，并由区城管局杨凯成局长、刘东贤大队长率先带领执法监察大队、环卫科、爱卫办相关科室人员分别深入街道、社区进行专项督导，积极组织全区各街道执法队全面打响全区环境卫生大检查大执法百日行动。', '2018-07-28 22:01:49', '待审核', '科室人员分别深入街道、社区进行专项督导，积极组织全区各街道执法队全面打响全区环境卫生大检查大执法百日行动。', 'e769827e-7ceb-4fbf-b051-f4135326e9b2');
INSERT INTO `appaction` VALUES ('decc9953-9999-4f0a-9493-a0292e12fcd3', '城管拾金不昧', ' 据失主讲，他是办事路过青年路时不慎将钱包弄丢的，当发现钱包丢失时，已经是下午两点多了。“当时心想肯定找不到了。没想到没多久单位的人跟我说你的钱包、手机找到了，被执法局的同志捡到了，电话打过来让你去领一下呢。真的太感谢执法人员了”事后失主激动地说。', '2018-07-28 22:01:47', '待审核', null, 'e769827e-7ceb-4fbf-b051-f4135326e9b2');
INSERT INTO `appaction` VALUES ('f535cb44-682d-4d0f-98f9-2948cd77396a', '全力抗击台风“安比”', ' 7月22日，今年第10号台风“安比”在周末强势来袭，为确保南通城区安全度汛，南通城管局取消周末休假，成立了20人的突击应急队，24小时值班，随时准备抗险救灾。', '2018-07-23 13:12:29', '通过', '南通城管局取消周末休假，成立了20人的突击应急队，24小时值班，随时准备抗险救灾。', 'e769827e-7ceb-4fbf-b051-f4135326e9b2');
INSERT INTO `appaction` VALUES ('f9d10e83-7077-4c0b-b367-c9d198ca6162', '采摘共享文明果实', ' 自打实施“果树进城”政策以来，城市道路两旁种植的瓜果，还未成熟时就有市民忍不住伸手采摘，不仅不文明也容易折损花草。为了引导广大市民养成良好的文明习惯，不采果折枝，不损毁花草，漯河市城市管理局“变堵为疏”，于近日举办了“同创文明城共享文明果”活动，如今果实已经成熟，漯河市城市管理局主动邀请市民来品尝这项活动带来的成果。', '2018-07-23 13:10:35', '通过', null, 'e769827e-7ceb-4fbf-b051-f4135326e9b2');
